import React, { Component } from 'react';
import { Link } from 'react-router-dom'

import { useNavigate } from 'react-router-dom';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import SearchIcon from '@material-ui/icons/Search';
import AccountCircle from '@material-ui/icons/AccountCircle';
import MailIcon from '@material-ui/icons/Mail';
import NotificationsIcon from '@material-ui/icons/Notifications';
import MoreIcon from '@material-ui/icons/MoreVert';
import { Favorite, GitHub, Info, DeveloperMode, Equalizer, Home } from '@material-ui/icons';
import CssBaseline from '@material-ui/core/CssBaseline';

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    menuButton: {
        marginRight: theme.spacing(2),
    },
    title: {
        flexGrow: 1,
    },
}));

export default function HeaderBar() {
    const classes = useStyles();
    let navigate = useNavigate()
    return (
        <React.Fragment>
            <CssBaseline />
        <div className={classes.root}>
            <AppBar position="static">
                <Toolbar>
                    <Typography variant="h6" className={classes.title}>
                        .ch Search Engine
                    </Typography>
                        <IconButton onClick={() => navigate("/")} aria-label="Home" color="inherit">
                        <Home />
                    </IconButton>
                        <IconButton onClick={() => navigate("/statistic")} aria-label="Statistics" color="inherit">
                        <Equalizer />
                    </IconButton>
                        <IconButton onClick={() => navigate("/impress")} aria-label="About searchzone.ch" color="inherit">
                        <Info />
                    </IconButton>
                    <Link to='https://react.semantic-ui.com/'>
                        <IconButton aria-label="Source Code" color="inherit">
                            <GitHub />
                        </IconButton>
                    </Link>
                    <IconButton onClick={() => navigate("/api")} aria-label="API" color="inherit">
                        <DeveloperMode />
                    </IconButton>
                    <IconButton aria-label="Show love" color="secondary">
                        <Favorite />
                    </IconButton>
                </Toolbar>
            </AppBar>
        </div>
        </React.Fragment>
    );
}
